// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

import "./VaultBase.sol";


pragma experimental ABIEncoderV2;

/**
* @title Corn Finance Accumulator Distributor Vault
* @author C.W.B.
*/
contract AccumulatorDistributorVault is VaultBase {
    constructor(
        address _controller, 
        uint256 _maxTokens, 
        string memory _name, 
        string memory _symbol, 
        string memory _URI
    ) public VaultBase(_controller, _maxTokens, _name, _symbol, _URI) {}

    // --------------------------------------------------------------------------------

    /**
    * @dev This contract is owned by the Controller. Call 'createTrade' from the Controller
    * to use this function.
    * @notice Sell price (1) > sell price (2) > sell price (3)
    * @param _from: Controller contract will forward 'msg.sender'
    * @param _tokens:
    *   [0] = from token 
    *   [1] = to token
    * @param _amounts: 
    *   [0] = {required} starting amount
    *   [1] = {required} buy price (token[0] / token[1]) * PRICE_MULTIPLIER()
    *   [2] = {required} sell price (1) (token[1] / token[0]) * PRICE_MULTIPLIER()
    *   [3] = {optional} sell price (2) (token[1] / token[0]) * PRICE_MULTIPLIER()
    *   [4] = {optional} sell price (3) (token[1] / token[0]) * PRICE_MULTIPLIER()
    * @param _times:
    *   [0] = Expiration time in Unix. Orders will not be filled after this time.
    * @return Order IDs of the created orders. Accum/Dist vault only creates the buy
    * order when creating a trade. Thus, only one order ID is returned.
    */
    function createTrade(
        address _from, 
        address[] memory _tokens, 
        uint256[] memory _amounts, 
        uint[] memory _times
    ) external onlyOwner returns (uint256[] memory) {
        // Only one expiration time allowed
        require(_times.length == 1, "CornFi AccumDist Vault: Invalid '_times' Length");

        // Trade consists of only two tokens
        require(_tokens.length == 2, "CornFi AccumDist Vault: Invalid '_tokens' Length");

        // Limit sell orders to 3. Deposit amount and buy price occupy the other two elements.
        require(
            _amounts.length >= 3 && _amounts.length <= 5, 
            "CornFi AccumDist Vault: Invalid Amounts Length"
        );

        // Check to make sure that the first rate is lower than the second rate. Note that 
        // _amounts[1] is an inverted rate of _amounts[2:]. To account for decimal precision
        // use (PRICE_MULTIPLIER ^ 2) instead of '1' as the numerator when inverting the rate.
        //
        // Failure to perform this check would result in a potentially continous state of
        // creating and filling orders!!
        //
        // ex. USDC --> WMATIC --> USDC (Swap USDC to WMATIC then swap the WMATIC back to USDC)
        // Buy price: 2.10 USDC / WMATIC
        // Sell price: 2.05 USDC / WMATIC
        //
        // From the above example, USDC is swapped for WMATIC when the rate falls below 2.10
        // and then swaps back to USDC when the rate is above 2.05. If the current rate is 2.08,
        // the USDC is swapped for WMATIC and an order is created to swap the WMATIC received 
        // for USDC at 2.05 or above. Since the current price remains at 2.08, the order 
        // that was just created is now able to be filled. The cycle will continue as filling
        // the WMATIC --> USDC order then creates a new order to swap the USDC back to WMATIC
        // at 2.10 or below. Again, these conditions are met immediately. The cycle will
        // repeat itself until the user either runs out of gas or the price moves out of
        // range.
        require(
            PRICE_MULTIPLIER.mul(PRICE_MULTIPLIER).div(_amounts[1]) > _amounts[2], 
            "CornFi AccumDist Vault: First Price Too High"
        );

        // Sell rates are elements [2:]
        uint256[] memory rates = new uint256[](_amounts.length.sub(2));
        for(uint i = 0; i < rates.length; i++) {
            rates[i] = _amounts[i+2];
        }

        // Sell rates must be in decending order
        require(
            _descendingOrder(rates), 
            "CornFi AccumDist Vault: Rates Are Not in Decending Order"
        );

        // Create the trade
        uint256 amountInWithFee = _createTrade(_from, _tokens, _amounts, _times);

        // Create the buy order
        uint256[] memory orderIds = new uint256[](1);
        orderIds[0] = _createOrder(
            tokenCounter.sub(1), 
            0, 
            [
                _tokens[0], 
                _tokens[1]
            ], 
            [
                amountInWithFee, 
                _getAmountOut(_tokens[0], _tokens[1], amountInWithFee, _amounts[1]), 
                0
            ], 
            _times
        );

        // Return the order ID of the buy order
        return orderIds;
    }

    // --------------------------------------------------------------------------------

    /**
    * @dev This contract is owned by the Controller. Call 'fillOrder' from the Controller
    * to use this function.
    * @param _from: Controller contract will forward 'msg.sender'
    * @param _orderId: Order to fill
    * @param _router: Router used to perform the swap (i.e. fill the order)
    * @param _path: Path used to perform the swap
    * @return Since Accum/Dist vault will continuously create orders after filling an
    * order, the created order is returned.
    */
    function fillOrder(
        address _from, 
        uint256 _orderId, 
        IUniswapV2Router02 _router, 
        address[] memory _path
    ) external onlyOwner returns (Order[] memory, uint256[] memory) {
        Order memory order_ = order(_orderId);

        // Fill order
        (uint256 minAmountOut, uint256 amountOut) = _swap(_from, order_, _router, _path);

        // Revert if swap amount out is too low
        require(
            minAmountOut >= order_.amounts[1], 
            "CornFi AccumDist Vault: Insufficent Output Amount"
        );

        // Create next order and return its order ID
        Order[] memory _orders = new Order[](1);
        _orders[0] = order(_create(order_));
        uint256[] memory filledOrders = new uint256[](1);
        filledOrders[0] = order_.orderId;
        return (_orders, filledOrders);
    }

    // --------------------------------------------------------------------------------

    /**
    * @dev This contract is owned by the Controller. Call 'withdraw' from the Controller
    * to use this function.
    * @notice After calling this function, all orders associated with '_tokenId' are
    * closed and their tokens are returned to the token owner. The token is then
    * burnt and cannot be used again.
    * @param _from: Controller contract will forward 'msg.sender'
    * @param _tokenId: Vault token to withdraw
    */
    function withdraw(address _from, uint256 _tokenId) external onlyOwner {
        _withdraw(_from, _tokenId);
    }


    // --------------------------------------------------------------------------------
    // ////////////////////////////// Internal Functions //////////////////////////////
    // --------------------------------------------------------------------------------

    /**
    * @dev Helper function to create orders. Use this over calling '_createOrder' directly
    * @param _tokenId: Vault token that will own the created order
    * @param _tradeId: The specific trade of a vault token that will include the created order.
    * @param _fromToken: Token to trade
    * @param _toToken: Token received from trade
    * @param _amountIn: Amount of '_fromToken' being traded
    * @param _price: Rate of '_fromToken' / '_toToken'
    * @param _times: Order expiration time
    * @return Order ID of the created order
    */
    function _createOrderHelper(
        uint256 _tokenId, 
        uint256 _tradeId, 
        address _fromToken, 
        address _toToken, 
        uint256 _amountIn, 
        uint256 _price, 
        uint[] memory _times
    ) internal returns (uint256) {
        return _createOrder(
            _tokenId, 
            _tradeId, 
            [
                _fromToken, 
                _toToken
            ], 
            [
                _amountIn, 
                _getAmountOut(_fromToken, _toToken, _amountIn, _price), 
                0
            ], 
            _times
        );
    }

    // --------------------------------------------------------------------------------

    /**
    * @dev Determines if the next order is a buy or sell
    * @param order: Order that was just filled. Next order is based on the current order
    * being filled.
    * @return Order ID of the created order 
    */
    function _create(Order memory order) internal returns (uint256) {
        // strategies[order.tokenId].amounts.length provides the count of
        // the initial buy amount, buy price, and sell prices. By subtracting
        // 2 from the length, the number of sell prices is determined.
        // The number of sell prices indicates the number of sell orders
        // within a trade. 
        uint256 length = strategies[order.tokenId].amounts.length.sub(2);

        // ----------------------------------------------------------------------------
        // As orders are added to a trade, 'tradeLength' is incremented.
        // This is done to help determine the parameters of the next order.
        // ----------------------------------------------------------------------------

        // Only one order is present in the trade. Next order will be the
        // reverse path of the order just filled.
        if(tradeLength[order.tokenId][order.tradeId] == 1) {
            return _createOrderHelper(
                order.tokenId, 
                order.tradeId, 
                order.tokens[1], 
                order.tokens[0], 
                orders[trades[order.tokenId][order.tradeId][0]].amounts[1].div(length),
                strategies[order.tokenId].amounts[tradeLength[order.tokenId][order.tradeId].add(1)], 
                order.times
            );
        }

        // Current trade is complete. Next order is the buy order of a new trade
        else if(tradeLength[order.tokenId][order.tradeId] == strategies[order.tokenId].amounts.length.sub(1)) {
            return _createOrderHelper(
                order.tokenId,
                order.tradeId.add(1), 
                order.tokens[1], 
                order.tokens[0], 
                tokenAmounts[order.tokenId][order.tokens[1]], 
                strategies[order.tokenId].amounts[1], 
                order.times
            );
        }

        // Trade still has remaining sell orders to create.
        else {
            return _createOrderHelper(
                order.tokenId, 
                order.tradeId, 
                order.tokens[0], 
                order.tokens[1], 
                orders[trades[order.tokenId][order.tradeId][0]].amounts[1].div(length), 
                strategies[order.tokenId].amounts[tradeLength[order.tokenId][order.tradeId].add(1)], 
                order.times
            );
        }
    }

    // --------------------------------------------------------------------------------

    /**
    * @dev Use for checking swap rates inputted when a user creates a trade
    * @param _values: Array of values to check if in decending order
    * @return true: Values are in decending order; false: Values are not in decending order 
    */
    function _descendingOrder(uint256[] memory _values) internal returns (bool) {
        for(uint i = 1; i < _values.length; i++) {
            if(_values[i-1] < _values[i]) {
                return false;
            }
        }
        return true;
    }
}
